//import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Header from './component/header/header';
function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route path='./' element={<Header/>}></Route>
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
